import { useState, useEffect } from "react";
import CompanyModal from "../../Common/CompanyModal";
import LoanIconButton from "../../../Common/LoanIconButton";
import { BsPlus } from "react-icons/bs";
import { IconButton } from "@material-tailwind/react";
import {
  InputLabel,
  TextField,
  MenuItem,
  FormControl,
  Select,
} from "@mui/material";
import CommonServices from "../../Common/CommonServices";
const EditMarriedStatus = ({ SoleId }) => {
  //starts married edit
  const [toggleEditMarriedInfo, setToggleEditMarriedInfo] = useState(false);
  const [submitted, setSubmitted] = useState(false);
  const [editedMarriedId, setEditedMarriedId] = useState();
  const [editMarriedInfo, setEditMarriedInfo] = useState({
    Id:EditedMarriedId,
    FirstName: "",
    MiddleName: "",
    LastName: "",
    NationalityID: "",
    CountryOfOriginID: "",
    CountryOfResidenceID: "",
    ProofOfIdentityTypeID: "",
    ProofOfIdentity: "",
    MarriageDate: "",
    MarriageCertificate: "",
    MarriageCertificateIssuer: "",
    ProofOfIdentityIssueDate: "",
    ProofOfIdentityExpirDate: "",
  });
  const updateMarriedById = (taxInformationId) => {
    CommonServices.getMarried(taxInformationId)
      .then((res) => {
        setEditMarriedInfo({
          ...editMarriedInfo,
          Id: taxInformationId,
          FirstName: res.data.Result.FirstName,
          MiddleName: res.data.Result.MiddleName,
          LastName: res.data.Result.LastName,
          NationalityID: res.data.Result.NationalityID,
          CountryOfOriginID: res.data.Result.CountryOfOriginID,
          CountryOfResidenceID: res.data.Result.CountryOfResidenceID,
          ProofOfIdentityTypeID: res.data.Result.ProofOfIdentityTypeID,
          ProofOfIdentity: res.data.Result.ProofOfIdentity,
          MarriageDate: res.data.Result.MarriageDate,
          MarriageCertificate: res.data.Result.MarriageCertificate,
          MarriageCertificateIssuer: res.data.Result.MarriageCertificateIssuer,
          ProofOfIdentityIssueDate: res.data.Result.ProofOfIdentityIssueDate,
          ProofOfIdentityExpirDate: res.data.Result.ProofOfIdentityExpirDate,
        });
      })
      .catch((err) => console.log(err));
  };
  useEffect(() => {
    updateMarriedById();
  }, []);
  const updateMarriedInfo = () => {
    CommonServices.updateMarried(taxInformationId, editMarriedInfo)
      .then((response) => {
        // navigation("/company/1");
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    updateMarriedInfo();
  }, []);
  //marriedEdit end
  return (
    <div>
      <button
        onClick={() => setToggleEditMarriedInfo(!toggleEditMarriedInfo)}
        className="text-purple-600 rounded-md font-medium "
      >
        Edit Married
      </button>

      {toggleEditMarriedInfo && (
        <div className="submit-form">
          {submitted ? (
            <div>
              <h4>You submitted successfully!</h4>
            </div>
          ) : (
            <div>
              <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
                <TextField
                  id="FirstName"
                  label="FirstName"
                  variant="standard"
                  color="secondary"
                  size=""
                  required
                  value={editMarriedInfo.FirstName}
                  onChange={(e) =>
                    setEditMarriedInfo({
                      ...editMarriedInfo,
                      Name: e.target.value,
                    })
                  }
                  name="FirstName"
                />
                <TextField
                  id="MiddleName"
                  label="MiddleName"
                  variant="standard"
                  color="secondary"
                  size=""
                  required
                  value={editMarriedInfo.MiddleName}
                  onChange={(e) =>
                    setEditMarriedInfo({
                      ...editMarriedInfo,
                      Name: e.target.value,
                    })
                  }
                  name="MiddleName"
                />
                <TextField
                  id="LastName"
                  label="LastName"
                  variant="standard"
                  color="secondary"
                  size=""
                  required
                  value={editMarriedInfo.LastName}
                  onChange={(e) =>
                    setEditMarriedInfo({
                      ...editMarriedInfo,
                      Name: e.target.value,
                    })
                  }
                  name="LastName"
                />

                <FormControl variant="standard" sx={{ minWidth: 120 }}>
                  <InputLabel id="countrylbl" color="secondary">
                    {" "}
                    Nationality{" "}
                  </InputLabel>
                  <Select
                    color="secondary"
                    onChange={(event) =>
                      (editMarriedInfo.NationalityID = event.target.value)
                    }
                    labelId="countrylbl"
                    id="countrySelect"
                    label="Country"
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    {country.map((yourCounty) => (
                      <MenuItem
                        key={yourCounty.Id}
                        NationalityID={yourCounty.Id}
                        value={yourCounty.Id}
                      >
                        {yourCounty.Name}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
                <FormControl variant="standard" sx={{ minWidth: 120 }}>
                  <InputLabel id="countrylbl" color="secondary">
                    {" "}
                    Country Of Origin{" "}
                  </InputLabel>
                  <Select
                    color="secondary"
                    onChange={(event) =>
                      (editMarriedInfo.CountryOfOriginID = event.target.value)
                    }
                    labelId="countrylbl"
                    id="countrySelect"
                    label="Country"
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    {country.map((yourCounty) => (
                      <MenuItem
                        key={yourCounty.Id}
                        NationalityID={yourCounty.Id}
                        value={yourCounty.Id}
                      >
                        {yourCounty.Name}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
                <FormControl variant="standard" sx={{ minWidth: 120 }}>
                  <InputLabel id="countrylbl" color="secondary">
                    {" "}
                    Country Of Residence{" "}
                  </InputLabel>
                  <Select
                    color="secondary"
                    onChange={(event) =>
                      (editMarriedInfo.CountryOfResidenceID =
                        event.target.value)
                    }
                    labelId="countrylbl"
                    id="countrySelect"
                    label="Country"
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    {country.map((yourCounty) => (
                      <MenuItem
                        key={yourCounty.Id}
                        NationalityID={yourCounty.Id}
                        value={yourCounty.Id}
                      >
                        {yourCounty.Name}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
                <FormControl variant="standard" sx={{ minWidth: 120 }}>
                  <InputLabel id="countrylbl" color="secondary">
                    {" "}
                    Proof Of Identity Type{" "}
                  </InputLabel>
                  <Select
                    color="secondary"
                    onChange={(event) =>
                      (editMarriedInfo.ProofOfIdentityTypeID =
                        event.target.value)
                    }
                    labelId="countrylbl"
                    id="countrySelect"
                    label="Country"
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    {proofOfIdentityType.map((yourProofOfIdentityType) => (
                      <MenuItem
                        key={yourProofOfIdentityType.Id}
                        ProofOfIdentityTypeID={yourProofOfIdentityType.Id}
                        value={yourProofOfIdentityType.Id}
                      >
                        {yourProofOfIdentityType.Name}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
                <TextField
                  id="ProofOfIdentity"
                  label="ProofOfIdentity"
                  variant="standard"
                  color="secondary"
                  size=""
                  required
                  value={editMarriedInfo.ProofOfIdentity}
                  onChange={(e) =>
                    setEditMarriedInfo({
                      ...editMarriedInfo,
                      Name: e.target.value,
                    })
                  }
                  name="ProofOfIdentity"
                />
                <TextField
                  id="MarriageDate"
                  label="MarriageDate"
                  variant="standard"
                  color="secondary"
                  size=""
                  required
                  value={editMarriedInfo.MarriageDate}
                  onChange={(e) =>
                    setEditMarriedInfo({
                      ...editMarriedInfo,
                      Name: e.target.value,
                    })
                  }
                  name="MarriageDate"
                />
                <TextField
                  id="MarriageCertificate"
                  label="MarriageCertificate"
                  variant="standard"
                  color="secondary"
                  size=""
                  required
                  value={editMarriedInfo.MarriageCertificate}
                  onChange={(e) =>
                    setEditMarriedInfo({
                      ...editMarriedInfo,
                      Name: e.target.value,
                    })
                  }
                  name="MarriageCertificate"
                />
                <TextField
                  id="MarriageCertificateIssuer"
                  label="MarriageCertificateIssuer"
                  variant="standard"
                  color="secondary"
